import './App.css';
import Login from './pages/Login';
import Home from './pages/Home';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';


function App() {
  return (

    <Router>
      <div className="App">
        <Login />
         <Switch>
          <Route path='/home'>
            <Home />
          </Route>

         </Switch>

      </div>
    </Router>
  );
}

export default App;
